import React, { useState } from "react";
import { Row, Col, Container, Card, Button, Modal, Form } from "react-bootstrap";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import "../User/WebSeries/WebSeries.css";
import Header from './Header';
import Footer from "./Footer";
const ChannelsData = [
  {
    id: 1,
    name: "Sun Groups ",
    location: "Tamil Nadu",
    imageUrl: "data:image/png;base64,",
    link: "/channels/sun-tv"
  },
  {
    id: 2,
    name: "Star Groups",
    location: "Tamil Nadu",
    imageUrl: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTaZgGbYaDG4NFhlQ6y_I2EO3mFQEUYJm4fLg&s",
    link: "/channels/polimer-tv"
  },
  {
    id: 3,
    name: "Zee Groups",
    location: "Tamil Nadu",
    imageUrl: "data:image/jpeg;base64,",
    link: "/channels/chutti-tv"
  },
  {
    id: 4,
    name: "Sony Groups ",
    location: "Tamil Nadu",
    imageUrl: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS_qgIqhq1x_pJsgyjDLooh17oO43vJTTGQFw&s",
    link: "/channels/ktv"
  },
  {
    id: 5,
    name: "Raj Groups ",
    location: "Tamil Nadu",
    imageUrl: "data:image/jpeg;base64,",
    link: "/channels/sun-music"
  },
  {
    id: 6,
    name: "kalaignar Groups",
    location: "Tamil Nadu",
    imageUrl: "data:image/jpeg;base64,",
    link: "/channels/vijay-tv"
  },

];

function Channels() {
  const [showFilterModal, setShowFilterModal] = useState(false);
  const [selectedGenres, setSelectedGenres] = useState([]);

  const handleFilterIconClick = () => {
    setShowFilterModal(true);
  };

  const handleFilterModalClose = () => {
    setShowFilterModal(false);
  };

  const handleClearFilters = () => {
    setSelectedGenres([]);
    setShowFilterModal(false);
  };

  const handleGenreCheckboxChange = (genre) => {
    const updatedGenres = [...selectedGenres];
    const index = updatedGenres.indexOf(genre);

    if (index === -1) {
      updatedGenres.push(genre);
    } else {
      updatedGenres.splice(index, 1);
    }

    setSelectedGenres(updatedGenres);
  };

  const filteredSeries =
    selectedGenres.length === 0
      ? ChannelsData
      : ChannelsData.filter((series) => selectedGenres.includes(series.genre));

  return (
    <div>
      <Header/>
      <div className="about">
        <Container >
          <h1 style={{ paddingTop: "8%"}}>Channels</h1>
          <div>
            <Row>
              <Col style={{marginLeft:'90%'}}>
              <Button
                variant="outline-dark"
                style={{ float: 'right', marginBottom: '20px', marginRight: '20px' }}
                onClick={handleFilterIconClick}
              >
                <FontAwesomeIcon icon="filter" style={{ marginRight: '5px' }} />
                Filter
              </Button>
              </Col>
            </Row>
          </div>
        </Container>
      </div>
      <div>
        <Container>
          <Row>
            {filteredSeries.map((series) => (
              <Col
                style={{ paddingTop: "2%" }}
                key={series.id}
                xs={12}
                sm={6}
                md={4}
                lg={2}
              >
                <a href={series.link} alt="" style={{ textDecoration: "none" }}>
                  <Card
                    className="tv-show-card"
                    style={{ width: "100%", marginBottom: "15px" }}
                  >
                    <Card.Img
                      variant="top"
                      src={series.imageUrl}
                      style={{ width: "100%", height: "150px", borderRadius:"10px"}}
                    />
                    <Card.Body>
                      <Card.Title>{series.title}</Card.Title>
                      <Card.Text style={{fontSize:"16px"}}><b>{series.name}</b></Card.Text>
                    
                
                    </Card.Body>
                  </Card>
                </a>
              </Col>
            ))}
          </Row>
        </Container>
      </div>
      <div style={{paddingBottom:"5%"}}>
      <Modal show={showFilterModal} onHide={handleFilterModalClose}>
        <Modal.Header closeButton>
          <Modal.Title>Filter by Genre</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            {Array.from(new Set(ChannelsData.map((series) => series.genre))).map((genre, index) => (
              <Form.Check
                key={index}
                type="checkbox"
                id={`genre-checkbox-${index}`}
                label={genre}
                checked={selectedGenres.includes(genre)}
                onChange={() => handleGenreCheckboxChange(genre)}
              />
            ))}
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClearFilters}>
            Clear
          </Button>
          <Button variant="primary" onClick={handleFilterModalClose}>
            Apply Filters
          </Button>
        </Modal.Footer>
      </Modal>
      </div>
      <Footer/>
    </div>
  );
}

export default Channels;
